import React, { Component } from 'react'
import Highcharts from 'highcharts';
import {
  HighchartsChart, Chart, withHighcharts, XAxis, YAxis, Title, Subtitle, Legend, LineSeries
} from 'react-jsx-highcharts';

class Graph extends Component {

  constructor(props){
    super(props)


  }

  render() {
    return (
      <HighchartsChart>
        <Chart />

        <Title>Dynamically updating data</Title>

        <Legend>
          <Legend.Title>Legend</Legend.Title>
        </Legend>

        <XAxis type="datetime">
          <XAxis.Title>Time</XAxis.Title>
        </XAxis>

        <YAxis>
          <YAxis.Title>Pressure (m)</YAxis.Title>
          <LineSeries name="Sensor 1" data={data1} />
          <LineSeries name="Sensor 2" data={data2} />
          </YAxis>
      </HighchartsChart>
    );
  }
}

export default Graph;
